INSERT INTO resume VALUES(5,'Ray Hsu 許朝昇','rayincosmos@gmail.com',NULL,'GliaCloud-(Sr.) Backend Engineer-Ray Hsu許朝昇.pdf',NULL,NULL,NULL,NULL,'SCHEDULED',NULL,NULL,unistr('l   7 years of software engineering experience, specializing in backend systems, cloud infrastructure, and AI LLM applications, with solid expertise in Node.js, Golang, and Python.\u000d\u000a\u000d\u000al   At BarkingDog AI, led teams of 2–3 to deliver AI-driven applications, optimized RAG accuracy by 20%, improved API processing speed by 35%, and drove company-wide Kubernetes adoption for 30% higher scalability and availability.\u000d\u000a\u000d\u000al   At Webduino, built a distributed Job Queue system supporting 1,000 concurrent users, integrated OAuth authentication to enhance UX, and cut AWS costs by 50% while ensuring service stability.\u000d\u000a\u000d\u000al   Strong in DevOps and performance optimization: automated deployments with Terraform & FluxCD, implemented monitoring via OpenTelemetry & Grafana, and optimized Node.js memory usage by 30%.\u000d\u000a\u000d\u000al   Skills: NodeJS, Typescript, Golang, Gin, Microservices, Python, PostgreSQL, MySQL, Redis, AWS, K8S, Docker, Terraform, Grafana\u000d\u000a\u000d\u000al   Current package is around 1.05M'),NULL,NULL,NULL,NULL,'lrs','5','2025-11-04 06:49:00.064866','2025-11-04 06:49:00.064872');
